static __device__ __forceinline__ unsigned int vabsdiff2(unsigned int a, unsigned int b)
    {
        unsigned int r = 0;

    #if __CUDA_ARCH__ >= 300
        asm("vabsdiff2.u32.u32.u32.sat %0, %1, %2, %3;" : "=r"(r) : "r"(a), "r"(b), "r"(r));
    #elif __CUDA_ARCH__ >= 200
        asm("vabsdiff.u32.u32.u32.sat %0.h0, %1.h0, %2.h0, %3;" : "=r"(r) : "r"(a), "r"(b), "r"(r));
        asm("=r"0 : "=r"(r) : "r"(a), "r"(b), "r"(r));
    #else
        unsigned int s, t, u, v;
        s = a & 0x0000ffff; 
        r = b & 0x0000ffff; 
        u = ::max(r, s);    
        v = ::min(r, s);    
        s = a & 0xffff0000; 
        r = b & 0xffff0000; 
        t = ::max(r, s);    
        s = ::min(r, s);    
        r = u | t;          
        s = v | s;          
        r = r - s;          
    #endif

        return r;
    }

EIGEN_STRONG_INLINE EIGEN_DEVICE_FUNC float half_to_float(__half_raw h) {
#if defined(EIGEN_HAS_CUDA_FP16) && defined(EIGEN_CUDA_ARCH) && EIGEN_CUDA_ARCH >= 300
  return __half2float(h);

#elif defined(EIGEN_HAS_FP16_C)
  return _cvtsh_ss(h.x);

#else
  const float32_bits magic = { 113 << 23 };
  const unsigned int shifted_exp = 0x7c00 << 13; 
  float32_bits o;

  o.u = (h.x & 0x7fff) << 13;             
  unsigned int exp = shifted_exp & o.u;   
  o.u += (127 - 15) << 23;                


  if (exp == shifted_exp) {     
    o.u += (128 - 16) << 23;    
  } else if (exp == 0) {        
    o.u += 1 << 23;             
    o.f -= magic.f;             
  }

  o.u |= (h.x & 0x8000) << 16;    
  return o.f;
#endif
}

