    {
        unsigned int r, c;

    #if __CUDA_ARCH__ >= 300
        r = vsetle2(a, b);
        c = r << 16;        
        r = c - r;          
    #else
        asm("not.b32 %0, %0;" : "+r"(a));
        c = vavrg2(a, b);   
        c = c & 0x80008000; 
        r = c >> 15;        
        r = c - r;          
        r = c | r;          
    #endif

