	if(Mode<1)return;
	if(Mode>=MAX_FUNC)return;
	BlendFunc func=blendfuncs[Mode];
	unsigned char *LinePS, *LinePD,*LinePM;
	for (int Y = 0; Y < Height; Y += 1)
	{
		LinePS = Src + Y * Width * 4;
