  int size=tab_mflops.size();


  for (int i=0 ; i < size ; i++){

    deque<double> sample;


    sample.push_back(tab_mflops[i]);

    for ( int j=1 ; j <= window_half_width ; j++ ){

      int before=i-j;
      int after=i+j;

      if ((before>=0)&&(after<size)) 
