StorageIndex cs_tdfs(StorageIndex j, StorageIndex k, StorageIndex *head, const StorageIndex *next, StorageIndex *post, StorageIndex *stack)
{
  StorageIndex i, p, top = 0;
  if(!head || !next || !post || !stack) return (-1);    
  stack[0] = j;                 
  while (top >= 0)                
  {
    p = stack[top];           
    i = head[p];              
    if(i == -1)
    {
      top--;                 
      post[k++] = p;        
    }
    else
    {
      head[p] = next[i];   
      stack[++top] = i;     
    }
  }
  return k;
}

