static __device__ __forceinline__ unsigned int vseteq4(unsigned int a, unsigned int b)
    {
        unsigned int r = 0;

    #if __CUDA_ARCH__ >= 300
        asm("vset4.u32.u32.eq %0, %1, %2, %3;" : "=r"(r) : "r"(a), "r"(b), "r"(r));
    #else


        unsigned int c;
        r = a ^ b;          
        c = r | 0x80808080; 
        r = r ^ c;          
        c = c - 0x01010101; 
        c = r & ~c;         
        r = c >> 7;         
    #endif

        return r;
    }

