void looper::loop() {
  while (true) {

    sem_wait(&headdataavailable);


    sem_wait(&headwriteprotect);
    loopermessage *msg = head;
    if (msg == NULL) {
      LOGV("no msg");
      sem_post(&headwriteprotect);
      continue;
    }
    head = msg->next;
    sem_post(&headwriteprotect);

    if (msg->quit) {
      LOGV("quitting");
      delete msg;
      return;
    }
    LOGV("processing msg %d", msg->what);
    handle(msg->what, msg->obj);
    delete msg;
  }
}

