  const auto odd = static_cast<__mmask32>(0xAAAAAAAAu);  


  auto u16 = hn::BitCast(du16, vbf).raw;

  asm("vmovdqu16 %[U16], %[U16]%{%[ODD]%}%{z%};"
      : [U16] "+v"(u16)    
      : [ODD] "Yk"(odd));  
  return hn::BitCast(df, hn::VFromD<decltype(du16)>{u16});
#else
  return hn::PromoteOddTo(df, vbf);
#endif
}

