        outConVar.wait_for(lck, std::chrono::milliseconds(200));
        log("output waiting end");
        isWaitingOut = false;
        return 0;
    }
    *data = queue.front();
    if (!(*data)) {
        pop();
        return 0;
    }
    return size();
}

