    if (startFunc) {
        startFunc();
    }
    if (notifyFunc) {
        notifyFunc(NOTIFY_START);
    }
    isStarted = true;

    while (mRunning) {
        if (mPausing) {
            std::unique_lock<std::mutex> lck(threadLock);
            conVar.wait(lck);
            continue;
        }
        if (!updateFunc) {
            break;
        }
        bool hasParams = arg1 >= 0 || arg2 >= 0;
        int updateResult = updateFunc(arg1, arg2);
        if (hasParams) {
            arg1 = -1;
            arg2 = -1;
        }
        if (updateResult == ERROR_EXIST) {
            mRunning = false;
            continue;
        } else if (updateResult == ERROR_PAUSE) {
            mPausing = true;
            continue;
        }
    }

    if (endFunc) {
        endFunc();
    }
    if (notifyFunc) {
        notifyFunc(NOTIFY_END);
    }
    isStarted = false;
}

