static inline
double jaccardDistance(const Rect_<_Tp>& a, const Rect_<_Tp>& b) {
    _Tp Aa = a.area();
    _Tp Ab = b.area();

    if ((Aa + Ab) <= std::numeric_limits<_Tp>::epsilon()) {

        return 0.0;
    }

    double Aab = (a & b).area();

    return 1.0 - Aab / (Aa + Ab - Aab);
}

