  VectorXd x_ref(n);
  x_ref << 0.08241058, 1.133037, 2.343695;
  VERIFY_IS_APPROX(x, x_ref);


  covfac = fnorm*fnorm/(m-n);
  internal::covar(lm.matrixR(), lm.permutation().indices()); 

  MatrixXd cov_ref(n,n);
  cov_ref <<
